export const classController = (req, res) => {
  res.render("admin/class");
};

export const studentController = (req, res) => {
  res.render("admin/student");
};

export const createStudentController = async (req, res) => {
  const {
    body: {
      stu_name,
      stu_gender,
      stu_school,
      stu_grade,
      stu_class,
      stu_birth,
      stu_hobby,
